import React from 'react';
import BlocksBoard from "./Components/BlocksBoard"
import GameBoard from './Components/GameBoard';

class App extends React.Component {
  constructor () {
    super()
    this.game_board = new GameBoard()
    this.board = this.game_board.board
  }

  ReturnMoveOptions (piece) {
    console.log(piece.move_option(this.board))
  }

  render () {
    return(
      <div>
        <BlocksBoard board = {this.board} ReturnMoveOptions = {this.ReturnMoveOptions}/>
        <p></p>
      </div>
    )
  }
}

export default App;
